  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0117497 includes chemical,
  discrete sample, physical and profile data collected from MARION DUFRESNE in the
  Indian Ocean and South Atlantic Ocean from 1985-02-27 to 1987-12-26 and retrieved
  during cruise INDIGO 123. These data include CHLOROFLUOROCARBON-11 (CFC-11), CHLOROFLUOROCARBON-12
  (CFC-12), DELTA CARBON-13, DELTA CARBON-14, DISSOLVED INORGANIC CARBON (DIC), DISSOLVED
  OXYGEN, HYDROSTATIC PRESSURE, NITRATE, NITRITE, PHOSPHATE, Potential temperature
  (theta), SALINITY, SILICATE, TOTAL ALKALINITY (TA) and WATER TEMPERATURE. The instruments
  used to collect these data include CTD and bottle. These data were collected by
  Gote H. Ostlund of Rosenstiel School of Marine and Atmospheric Science as part of
  the INDIGO 123 data set.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
